
/*Table structure for table `pontos` */

DROP TABLE IF EXISTS `pontos`;

CREATE TABLE `pontos` (
  `id` INTEGER,
  `nome` VARCHAR(600) DEFAULT NULL,
  `latitude` DECIMAL(10,8) DEFAULT NULL,
  `longitude` DECIMAL(11,8) DEFAULT NULL,
  `tipo` VARCHAR(20) DEFAULT NULL,
  PRIMARY KEY (`id`)
);

